.list-menu {
  padding: 0;
  margin: 0 0 1.5em;
  list-style: none;
  float: left;
  width: 100%;
  clear: both;

  &:last-child {
    margin-bottom: 0;
  }

  li {
    float: left;
    display: block;
    background: none !important;
    padding: 0 0.6em 0 0;
    margin: 0 0.6em 0.6em 0;
    border-width: 0 1px 0 0;

    &:last-child {
      border-right-width: 0;
    }
  }
}

.list-menu.links {
  li {
    padding: 0;
    margin: 0 2px 2px 0;
  }

  a {
    text-transform: capitalize;
    display: block;
    background: #f5f5f5;
    background: rgba(0, 0, 0, 0.04);
    padding: 0.4em 0.7em;

    &:hover {
      background: rgba(0, 0, 0, 0.07);
      color: #000;
    }

    &:focus {
      background: rgba(0, 0, 0, 0.07);
      color: #000;
    }

    &:active {
      background: rgba(0, 0, 0, 0.12);
    }
  }
}

#main-navigation {
  background: #666;
  color: #fff;

  li {
    margin: 0 1px 0 0;
    font-family: -apple-system, system-ui, BlinkMacSystemFont, Avenir Next, "Segoe UI", Roboto, Helvetica Neue, sans-serif;
    font-size: 15px;
    line-height: 18px;

    &:hover {
      >a {
        background: #444;
        background: rgba(0, 0, 0, 0.3);
      }
    }
  }

  a {
    color: #fff;
    padding: 14px 1.5em;
    text-decoration: none;
    background: transparent;
    transition: background-color .15s;

    &:hover {
      background: #444;
      background: rgba(0, 0, 0, 0.3);
    }

    &:focus {
      background: #444;
      background: rgba(0, 0, 0, 0.3);
    }
  }

  li.active {
    >a {
      background: #444;
      background: rgba(0, 0, 0, 0.3);
    }
  }
}

